import React from 'react';
import Layout from '../components/Layout';

const Index = ({children}) => (
    <>
        <Layout /> 
        {children}
        <div className="container">
            <div className="row">
                <div className="col-6">1</div>
                <div className="col-6">2</div>
            </div>
        </div>
    </>
   
  )
  
  export default Index
